import React, { Component } from "react";

class OurSponsors extends Component {

    render() {
        return (
            <div>
                <div style={{ padding: "70px 0", backgroundColor: "pink" }}>
                    <h2 style={{ textAlign: "center" }}>Investors</h2>
                    <div data-uk-scrollspy="target: > img; cls:uk-animation-fade; delay: 200">
                        <img style={{margin: "30px"}} src="./images/endorsements/1.png" alt="" />
                        <img style={{margin: "30px"}} src="./images/endorsements/6.png" alt="" />
                    </div>
                </div>
                <div style={{ padding: "70px 0", backgroundColor: "pink" }}>
                    <h2 style={{ textAlign: "center" }}>Sponsors</h2>
                    <div style={{display: "flex"}}>

                    </div>
                </div>
            </div>

        );
    }
}
export default OurSponsors;
